import './Login.css';
import logo from './../../images/logo.png';
import {Link} from 'react-router-dom';
import {Container} from 'reactstrap';

function Login(){
    return(
        <Container fluid={true}>
            <div>
                <img src={logo} alt=""/>
            </div>
        </Container>
    );
}
export default Login;
